  false,\n\t\"url\": null,\n\t\"notes\": \"Conductivity Temperature and Depth (CTD)
  measurements were collected aboard the R/V F.G. Walton Smith, Cruise 04, Leg2, to
  determine physical oceanographic parameters of the water column, and in some cases
  used to help guide sample collection as part of the Deepwater Horizon oil spill
  sampling effort. Temperature, conductivity/salinity, depth, dissolved oxygen, turbidity
  and fluorometry data were collected onboard the R/V F.G. Walton Smith. The final
  product is a series of NetCDF files containing every CTD cast that has been processed
  and quality checked.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
